import React from "react";
import "./App.css";

function App() {
  return (
    <div>
      <h1 class="ui header"> REST API Calculations </h1>

      <form class="ui form">
        <div class="field">
          <label>First Numeber</label>
          <input type="text" name="first-name" placeholder="First Name" />
        </div>
      </form>
    </div>
  );
}

export default App;
